// src/components/QuizApp.js

import React, { useState, useEffect } from "react";
import "../styles/Quiz.css"; // Import the CSS file

const QuizApp = () => {
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);
  const [selectedAnswers, setSelectedAnswers] = useState({});
  const [timeLeft, setTimeLeft] = useState(60); // Total time for the quiz
  const totalQuestions = questions.length;

  const questions = [
    {
      question: "What is the capital of France?",
      options: ["Berlin", "Madrid", "Paris", "Rome"],
      answer: "Paris",
    },
    {
      question: "Which planet is known as the Red Planet?",
      options: ["Earth", "Mars", "Jupiter", "Saturn"],
      answer: "Mars",
    },
    {
      question: 'Who wrote "To Kill a Mockingbird"?',
      options: ["Harper Lee", "J.K. Rowling", "Mark Twain", "Ernest Hemingway"],
      answer: "Harper Lee",
    },
    // Add more questions as needed
  ];

  useEffect(() => {
    if (timeLeft > 0) {
      const timer = setTimeout(() => setTimeLeft(timeLeft - 1), 1000);
      return () => clearTimeout(timer);
    } else {
      // Handle time up (e.g., submit the quiz)
    }
  }, [timeLeft]);

  const handleAnswerSelect = (option) => {
    setSelectedAnswers({
      ...selectedAnswers,
      [currentQuestionIndex]: option,
    });
  };

  const handleNextQuestion = () => {
    setCurrentQuestionIndex((prevIndex) =>
      Math.min(prevIndex + 1, totalQuestions - 1)
    );
  };

  const handlePreviousQuestion = () => {
    setCurrentQuestionIndex((prevIndex) => Math.max(prevIndex - 1, 0));
  };

  const currentQuestion = questions[currentQuestionIndex];
  const answeredQuestions = Object.keys(selectedAnswers).length;

  return (
    <div className="quiz-app">
      {/* Top Navigation Bar */}
      <nav className="navbar">
        <div className="logo">Jeppiaar University</div>
        <div className="nav-links">
          {/* Add navigation links if needed */}
        </div>
      </nav>

      {/* Main Content Area */}
      <div className="quiz-body">
        <div className="quiz-container">
          <div className="question-section">
            <h2>Quiz</h2>
            <h3>
              {currentQuestionIndex + 1}. {currentQuestion.question}
            </h3>
            <ul className="options">
              {currentQuestion.options.map((option, index) => (
                <li
                  key={option}
                  className={`option ${
                    selectedAnswers[currentQuestionIndex] === option
                      ? "selected"
                      : ""
                  }`}
                  onClick={() => handleAnswerSelect(option)}
                >
                  <span>{String.fromCharCode(65 + index)}.</span> {option}
                </li>
              ))}
            </ul>

            <div className="navigation-buttons">
              {currentQuestionIndex > 0 && (
                <button onClick={handlePreviousQuestion}>Previous</button>
              )}
              {currentQuestionIndex < totalQuestions - 1 && (
                <button onClick={handleNextQuestion}>Next</button>
              )}
            </div>
          </div>

          {/* Timer Section */}
          <div className="timer-section">
            <div className="timer-circle">
              <svg>
                <circle r="50" cx="60" cy="60"></circle>
                <circle
                  r="50"
                  cx="60"
                  cy="60"
                  style={{
                    strokeDashoffset: 314 - (timeLeft / 60) * 314,
                  }}
                ></circle>
              </svg>
              <div className="timer-text">{timeLeft}s</div>
            </div>
          </div>
        </div>
      </div>

      {/* Footer Section */}
      <footer className="footer">
        <p>
          Questions Answered: {answeredQuestions}/{totalQuestions}
        </p>
      </footer>
    </div>
  );
};

export default QuizApp;
